'use client'
import { Bar } from "react-chartjs-2";
import { Chart, LinearScale, CategoryScale, BarElement, Title, Tooltip, Legend, ChartData, CoreChartOptions, ElementChartOptions, PluginChartOptions, DatasetChartOptions, ScaleChartOptions, BarControllerChartOptions, ChartOptions } from 'chart.js';

Chart.register(LinearScale, CategoryScale, BarElement, Title, Tooltip, Legend);

export const BProject = () => {

    const teams = [
        { name: "B1", donationsCount: 10, color: "#1E64AF" },
        { name: "B2", donationsCount: 15, color: "#FAAF96" },
        { name: "B3", donationsCount: 12, color: "#F57282" },
        { name: "B4", donationsCount: 8, color: "#375A7D" },
        { name: "B5", donationsCount: 20, color: "#BE6E82" },
        { name: "B6", donationsCount: 16, color: "#69BEEB" },
        { name: "B7", donationsCount: 5, color: "#6E5A7D" },
        { name: "B8", donationsCount: 16, color: "#6E5A7D" },
    ];

    const data: ChartData<"bar", number[], string> = {
        labels: teams.map((team) => team.name),

        datasets: [
            {
                label: 'Información de equipos',
                maxBarThickness: 20,
                data: teams.map((team) => team.donationsCount),
                backgroundColor: teams.map((team) => team.color),
                borderRadius: 50,
            },
        ],
    };


    const plugin = {
        id: 'customCanvasBackgroundColor',
        beforeDraw: (chart: any, options: any) => {
            const { ctx } = chart;
            ctx.save();
            ctx.globalCompositeOperation = 'destination-over';
            ctx.fillStyle = options.color || '#000000';
            ctx.fillRect(0, 0, chart.width, chart.height);
            ctx.restore();
        }
    };

    const options: ChartOptions<"bar"> = {
        responsive: true,

        plugins: {
            title: {
                color: "#ffffff",
                display: true,
                text: 'Recaudación de cuponera por equipo',
            },

            legend: {
                display: false
            },
            customCanvasBackgroundColor: {
                color: '#000000',
            }
        } as any,
        scales: {
            x: {
                title: {
                    display: false
                },
                grid: {
                    display: false,
                    drawOnChartArea: true,
                    lineWidth: 1.5,
                    color: '#333333',
                },
                border: {
                    color: "#ffffff",
                    width: 2,
                },
                ticks: {
                    color: "#ffffff",
                },

            },
            y: {
                title: {
                    display: false
                },
                ticks: {
                    color: "#ffffff",
                },
                beginAtZero: true,
                border: {
                    color: "#ffffff",
                    width: 2,
                    z: 20
                }

            },
        },
    };

    return (
        <section className="bg-black flex flex-col items-start justify-center py-12 px-12 gap-6 md:flex-row md:justify-between  ">

            <div className="flex flex-col justify-center items-center gap-6 md:w-5/12  ">
                <BSvg className="w-[100%]" />

                <p className="text-white font-bold max-w-[400px] text-center ">
                    Gráfica de recaudación por equipo en la venta de cuponera Banco de Alimentos
                </p>

                {/* <button className="p-4 text-white bg-primary font-bold w-[80%]">
                    más información
                </button> */}
            </div>

            <div className="w-full h-full flex justify-center items-center md:justify-end px-6 md:p-0 md:w-7/12 ">
                <Bar className="w-full h-full" plugins={[plugin]} data={data} options={options} />
            </div>

        </section>
    );
}


